        <h1>Watch Tv App</h1>
        <Switch>
            <Link to ="/">Home</Link>{" "}
            <Link to ="/users">Users</Link>{" "}
            <Link to ="/shows">Shows</Link>{" "}
            <Link to ="/addShow">addShow</Link>{" "}
            <Link to ="/about">About</Link>{" "}
        </Switch>
    </nav>

</div>
)
}

export default Nav;
